import React from "react";

const Qution = () => {
  return (
    <div style={{ width: "100%", display: "flex" }}>
      <div style={{ width: "50%" }}>
        <h1 style={{ width: "60%", fontSize: "36px", fontWeight: "600" }}>
          Your questions, answered
        </h1>
      </div>
      <div>
        <div style={{ display: "flex" ,width:"100%",gap:"200px"}}>
          <div style={{fontSize:'26px'}}>Is my place right for Airbnb?</div>
          <img style={{ height: "20px" }} src="./img/aa.png" alt="" />
        </div>
      </div>
    </div>
  );
};

export default Qution;
